import { AspectRatio, Box, Heading, Skeleton } from "@chakra-ui/react";

export default function Pic(props) {
  const { numero } = props;
  return (
    <Box>
      <Heading size="md">GIORNO {numero}</Heading>
      <Box shadow="md" m={4}>
        <Skeleton>
          <AspectRatio ratio={1}>
            <Image></Image>
          </AspectRatio>
        </Skeleton>
      </Box>
    </Box>
  );
}
